import './css/App.css';
import Header from './components/Header/Header';
import { useState } from 'react';

function App() {
  let [curLang, setCurLang] = useState("ru")
  let [languages, setLanguages] = useState([
    "ru", "en", "ук"
  ])
  let translatedText = {
    "ru" : {
      "header": {
        "title": "юридическая компания"
      }
    }
  }
  function setLanguage(e) {
    console.log("here: ");
    console.log();
    setCurLang(e.target.value)
  }

  return (
   <>
    <Header text = {translatedText[curLang].header} languages = {languages} curLang = {curLang} setLanguage = {setLanguage} >
    </Header>
   </>
  );
}

export default App;
